 additional 7-day free trial for both public and private repos.</p><vscode-button data-action="command:gitlens.plus.loginOrSignUp">Sign in to GitLens+</vscode-button><p>✨ The Visual File History is <a title="Learn more about GitLens+ features" href="command:gitlens.plus.learn">GitLens+ feature</a> which can be used on public repos with a <a title="Sign in" href="command:gitlens.plus.loginOrSignUp">free account</a> and private repos with a <a title="View plans" href="command:gitlens.plus.purchase">paid account</a>.</p><p><i class="codicon codicon-info"></i>&nbsp;All other GitLens features can always be used on any repo, without an account.</p></section></template><template id="state:plus-trial-expired"><section><p>Upgrade your account to use the Visual File History and other GitLens+ features on private repos.</p><vscode-button data-action="command:gitlens.plus.purchase">Upgrade your account</vscode-button><p>✨ The Visual File History is <a title="Learn more about GitLens+ features" href="command:gitlens.plus.learn">GitLens+ feature</a> which can be used on public repos with a free account and private repos with a <a title="Upgrade your account" href="command:gitlens.plus.purchase">paid account</a>.</p><p><i class="codicon codicon-info"></i>&nbsp;All other GitLens features can always be used on any repo, without an account.</p></section></template><template id="state:verify-email"><section><h3>Please verify your email</h3><p>To use the Visual File History, please verify the email for the account you created.</p><vscode-button data-action="command:gitlens.plus.resendVerification">Resend verification email</vscode-button><vscode-button data-action="command:gitlens.plus.validate">Refresh verification status</vscode-button></section></template></html>
